  return (
    <div className="guess-results">
      {range(NUM_OF_GUESSES_ALLOWED).map((num) => (
        <Guess key={guesses[num] ? guesses[num].id:num } value={guesses[num]} answer={answer}/>
      ))}
    </div>


  );
}

